import React from 'react';
import { useNavigate } from 'react-router-dom';
import Grid from '@mui/material/Grid';
import {
  Typography,
  Container,
  List,
  ListItem,
  Divider,
  ListItemText,
} from '@mui/material';
import { styled } from '@mui/system';

const Box = styled('div')({
  display: 'flex',
  height: '100%',
  border: '1px solid #6D8472',
  borderRadius: '15px',
  padding: '10px'
});
const Item = styled('div')({
  display: 'flex',
  flexDirection: 'column',
  padding: '10px',
});
const ProgButton = styled('button')({
  backgroundColor: '#0171e3',
  width: '430px',
  height: '50px',
  margin: '10px',
  color: 'white',
  padding: '5px 10px',
  border: 'none',
  borderRadius: '5px',
  alignSelf: 'center'
});

const experiencesData = [
  {
    id: 'premium-subscription',
    title: 'Premium',
    subtitle: 'Most Popular!',
    description: 'Includes experience from all other plans',
    items: [
      {
        primary: 'Ernst & Young (Sydney)',
        secondary: 'Assurance Audit Cadetship(Sydney)',
        details: 'Conducted financial audits for a portfolio of over 20 clients in the Technology, Media, and Telecommunications industry'
      },
      {
        primary: 'Teamwork & Leadership',
        details: 'Led teams of graduate-level auditors, providing clear direction, delegation, and delivering feedback.'
      },
      {
        primary: 'Client Driven',
        details: 'Upheld clientele relationships to enhance financial analysis accuracy throughout the audit process and maximize stakeholder value.'
      },
      {
        primary: 'Skills Acquired',
        details: 'Proficient in audit and accounting software (EY Helix, SAP, Oracle, Xero) and Microsoft Excel for analytics.'
      }
    ]
  },
  {
    id: 'plus-subscription',
    title: 'Plus',
    description: 'Sales and Customer Experience Driven',
    items: [
      {
        primary: 'JB HI-FI (Sydney)',
        secondary: 'Sales',
        details: 'Superseded weekly KPI’s and deploying cross-selling techniques to enhance customer service ratings.'
      },
      {
        primary: 'Customer Focused',
        details: 'Translated technological specifications to easily understandable benefits for a diverse customer base.'
      },
      {
        primary: 'Consistent Learning',
        details: 'Rapidly assimilated knowledge with partners (Apple, Samsung, Google, etc.) to stay at the forefront of technology trends.'
      },
      {
        primary: 'Skills Acquired',
        details: 'Overcoming and handling objections, persistence to achieve results, prospecting.'
      }
    ]
  },
  {
    id: 'base-subscription',
    title: 'Base',
    description: 'Retail and Customer Service',
    items: [
      {
        primary: 'UNIQLO (Sydney)',
        secondary: 'Retail Associate',
        details: 'Assisted in customer engagement and sales.'
      },
      {
        primary: 'Teamwork',
        details: 'Worked closely with store managers and supervisors in order to drive deliverable completion.'
      },
      {
        primary: 'Customer service',
        details: 'Achieved 85% turnover of customers to membership sign-ups, to incentivize repeat customers.'
      },
      {
        primary: 'Skills Acquired',
        details: 'Teamwork and communication.'
      }
    ]
  }
];

const ExperienceBox = ({ id, title, subtitle, description, items }) => (
  <Grid item xs={4}>
    <Box>
      <Grid sx={{ flexGrow: 1, height: '100%' }} container spacing={2}>
        <Grid item xs={12} sx={{ height: '20%' }}>
          <Item id={id} className="subscription-head">
            {subtitle && <Typography sx={{ fontSize: '.7rem' }}>{subtitle}</Typography>}
            <Typography sx={{ fontSize: '1.4rem' }}>{title}</Typography>
            <Typography sx={{ fontSize: '.7rem' }}>{description}</Typography>
          </Item>
        </Grid>
        <Grid item xs={12} sx={{ height: '80%' }}>
          <List sx={{ padding: '0', width: '100%', maxWidth: '500px' }}>
            {items.map((item, index) => (
              <React.Fragment key={index}>
                <ListItem alignItems="flex-start">
                  <ListItemText
                    primary={item.primary}
                    secondary={
                      <>
                        {item.secondary && (
                          <Typography style={{ color: '#e8e5df', fontStyle: 'italic', fontSize: '.8rem' }}>
                            {item.secondary}
                          </Typography>
                        )}
                        <Typography style={{ color: '#e8e5df', fontWeight: 'lighter', fontSize: '.8rem' }}>
                          {item.details}
                        </Typography>
                      </>
                    }
                  />
                </ListItem>
                {index < items.length - 1 && <Divider variant="middle" component="li" sx={{ backgroundColor: '#6D8472' }} />}
              </React.Fragment>
            ))}
          </List>
        </Grid>
      </Grid>
    </Box>
  </Grid>
);

function Experiences({ token, setTokenFunction }) {
  const navigate = useNavigate();

  const goToProjects = () => {
    navigate('/projects');
  };

  return (
    <div sx={{ display: 'flex', flexDirection: 'column', alignContent: 'center', justifyContent: 'center' }}>
      <Container component="main" maxWidth="md" sx={{ display: 'flex', flexDirection: 'column', paddingBottom: '50px' }}>
        <Typography sx={{ fontSize: '1rem', color: '#a7a396' }}>
          Step <b>1</b> of <b>3</b>
        </Typography>
        <Typography sx={{ fontSize: '2rem', fontWeight: '500' }}>
          Choose an Experience
        </Typography>
        <Grid sx={{ flexGrow: 1 }} container spacing={2}>
          {experiencesData.map((experience) => (
            <ExperienceBox key={experience.id} {...experience} />
          ))}
        </Grid>
      </Container>
      <div style={{ display: 'flex', justifyContent: 'center', width: '100%' }}>
        <ProgButton onClick={goToProjects}>Next</ProgButton>
      </div>
    </div>
  );
}

export default Experiences;
